import React from "react";
import { NavLink } from "react-router-dom";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import { Helmet } from "react-helmet";
import "../../App.css";
import { useSelector } from "react-redux";

const Navbar = () => {
  const NavbarTitle = {
    color: "white",
    textDecoration: "none",
    fontSize: "30px",
  };
  //   const NavbarLink = {
  //     color: "white",
  //     textDecoration: "none",
  //     fontSize: "24px",
  //   };

  const data = useSelector((state) => state);
  console.log("data in navbar", data.cartItems.cartCount);
  return (
    <AppBar position="static">
      <Helmet>
        <title>My App</title>
      </Helmet>
      <Toolbar style={{ display: "flex", justifyContent: "space-between" }}>
        <Typography
          variant="h6"
          component={NavLink}
          to="/"
          exact
          style={NavbarTitle}
        >
          My App
        </Typography>
        <div style={{ display: "flex", gap: "20px" }}>
          <NavLink
            to="/"
            exact
            style={({ isActive }) => {
              return (
                { backgroundColor: isActive ? "lightblue" : "" },
                {
                  color: "white",

                  textDecoration: "none",
                  fontSize: "24px",
                }
              );
            }}
          >
            <Button color="inherit" sx={{ fontSize: "20px" }}>
              Home
            </Button>
          </NavLink>
          <NavLink
            to="/aboutus"
            style={({ isActive }) => {
              return (
                { backgroundColor: isActive ? "lightblue" : "" },
                {
                  color: "white",

                  textDecoration: "none",
                  fontSize: "24px",
                }
              );
            }}
          >
            <Button color="inherit" sx={{ fontSize: "20px" }}>
              About Us
            </Button>
          </NavLink>
          <NavLink
            to="/contactus/"
            style={({ isActive }) => {
              return (
                { backgroundColor: isActive ? "lightblue" : "" },
                {
                  color: "white",

                  textDecoration: "none",
                  fontSize: "24px",
                }
              );
            }}
          >
            <Button color="inherit" sx={{ fontSize: "20px" }}>
              Contact Us
            </Button>
          </NavLink>
          <NavLink
            to="/users"
            style={({ isActive }) => {
              return (
                { backgroundColor: isActive ? "lightblue" : "" },
                {
                  color: "white",

                  textDecoration: "none",
                  fontSize: "24px",
                }
              );
            }}
          >
            <Button color="inherit" sx={{ fontSize: "20px" }}>
              Users
            </Button>
          </NavLink>
          <NavLink
            to="/login"
            style={({ isActive }) => {
              return (
                { backgroundColor: isActive ? "lightblue" : "" },
                {
                  color: "white",

                  textDecoration: "none",
                  fontSize: "24px",
                }
              );
            }}
          >
            <Button color="inherit" sx={{ fontSize: "20px" }}>
              Login
            </Button>
          </NavLink>
          <NavLink
            to="/cart"
            style={({ isActive }) => {
              return (
                { backgroundColor: isActive ? "lightblue" : "" },
                {
                  color: "white",

                  textDecoration: "none",
                  fontSize: "24px",
                }
              );
            }}
          >
            <Button color="inherit" sx={{ fontSize: "20px" }}>
              Cart:{data.cartItems.cartCount}
            </Button>
          </NavLink>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;

